import React, { Component } from 'react';
import {Text, View, Image} from 'react-native';
import chicaCompu from '../../../imagenes/chicaCompu.jpeg'

export default class ImagenFondo extends Component {
    static navigationOptions = {
      header: null
    }
    render() {
        return (
          <View style={{ flex: 1 }}>
            <Image
              style={{
                resizeMode: "cover",
                width: "100%",
                height: "100%",
                justifyContent: "center",
                alignItems: "center",
                opacity: 0.4
              }}
             /*  source={require("../assets/images/menuBackgroundImage.jpg")} */
            ></Image>

            <View style={{
                width: chicaCompu.width,
                height: chicaCompu.height * 0.55,
                position: 'absolute',
                bottom: 0}}>
                <Text style={{
                    fontSize: 48
                }}>Glad to Meet You!</Text>
            </View>
          </View>
        );
    }
}
